import React, { Component } from 'react'
import { FaTimes } from "react-icons/fa";


export class ShowContact extends Component {
  render() {
    return (
      <div className='menu'>
        <div className='blur'/>
        <div className='menu__content'>
          <FaTimes className='nk' onClick={() => this.props.onShowCont()}/>
          <div className='menu__header'>Контакты</div><br></br>
          <ul className='lilka'>
            <li><a>WhatsApp: 8 (XXX) XXX XX-XX</a></li>
            <li><a>Telegram: 8 (XXX) XXX XX-XX</a></li>
            <li><a>Instagram: @cherlston</a></li>
          </ul>
        </div>
      </div>
    )
  }
}

export default ShowContact
